import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './pages'; // Import the HomePage component
import CarbonFootprintPage from './pages'; // Import the CarbonFootprintPage component

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} /> {/* Home Page Route */}
        <Route path="/carbon-footprint" element={<CarbonFootprintPage />} /> {/* Carbon Footprint Page Route */}
        {/* Add other routes as needed */}
      </Routes>
    </Router>
  );
};

export default App;
